import React, { Component } from 'react'

class App extends Component {

  async postData(){

    try{
      const response = await fetch('http://localhost:5000/simulacao', {
        method: 'POST',
        headers: {
          'Accept': 'application/json',
          'Content-Type': 'application/json',
        },
        body: JSON.stringify({
          nome: "a",
          email: "b",
          telefone: "c",
          senha_acesso: "d",
          quantidade: "1",
          tempo_investimento: "2"
        })
      });
      const data = await response.json;
      console.log(data)
    }catch(e){
      console.log(e)
    }

  }

  render(){
    return (
      <div className="App">
        <button onClick={ () => this.postData() }>send POST request</button>
      </div>
    );
}
}

export default App;
